import React, { Component } from 'react';

class MiniTask extends Component {

    constructor(props) {
        super(props);

        this.state = {
            content: props.content,
        }
    }

    render() {
        return (
            <div class="mini-task">{this.state.content}</div>
        )
    }
}

export default MiniTask;
